import React from 'react';
import logo from "./../../Assets/logo.png";
import "./Sidebar.css";


function Sidebar() {
    return (
      <div className="sidebar">
        <img src={logo}></img>
        <h1>Safepick</h1>
        <div>
            <div>Products</div>
            <div>Users</div>
            <div>Communities</div>
            <div>Notifications</div>
        </div>
      </div>
    );
  }


export default Sidebar;
